import Model from './Model';
import InitialState from './InitialState';

const reducer = (state = InitialState, action) => {
  switch (action.type) {
    case Model.SET_MESSAGE_SHOWING:
      return {
        ...state,
        messageShowing: action.value,
        messageText: action.text,
        messageHead: action.head,
        messageUlData: action.ulData,
      };
    default:
      return state;
  }
};

export default reducer;
